window.bookSummaryJSON = "<p><b>Pack rule number one: Never reveal to a human.</b></p> <p>I broke that rule the day I met the beautiful doctor.&nbsp;</p> <p>I might be a rodeo champ, but one look at her, and I lost my concentration.&nbsp;</p> <p>The bull tossed and gored me, and now the sweet female is on to me.&nbsp;</p> <p>When I healed within hours, she knew something wasn’t right.&nbsp;</p> <p>My alpha told me to watch her.&nbsp;</p> <p>Not a problem. I’ll watch her all right. Real close.&nbsp;</p> <p>I’ll stick to her like superglue.&nbsp;</p> <p>And those human men who want to date her?&nbsp;</p> <p>They’d better step back.&nbsp;</p> <p>Because the doctor is all mine.&nbsp;</p> <p>Whether she knows it yet or not.</p>"; 
